import React from 'react';
import {Card, Container, Image} from "react-bootstrap";
import {useHistory} from 'react-router-dom';
import {DEVICE_ROUTE} from "../utils/consts";

const DeviceTable = ({device}) => {
    const history = useHistory();
    console.log(device);
    return (
        <Container onClick={() => history.push(DEVICE_ROUTE + '/' + device.id)}>
            <td>
                <Image width={200} src={process.env.REACT_APP_API_URL + device.img}/>
                </td>
                <td width={200}>{device.name}</td>
                <td width={200}>{device.brand.name}</td>
                <td width={200}>{device.name}</td>
                <td width={200}>{device.price}</td>
                <td width={200}>{device.rating}</td>
              
  </Container>
           
    );
};

export default DeviceTable;
